  false,\n\t\"url\": null,\n\t\"notes\": \"Intermap DEMs populate its data store.
  The DEM products are generated using Intermap's STAR technology (Interferometric
  Synthetic Aperture Radar). The system is mounted in an aircraft. The Digital Terrain
  Model (DTM) data product was derived from the Digital Surface Model (DSM) using
  Intermap's proprietary algorithm. The DTM data for 7.5-minute by 7.5-minute units
  correspond to the USGS 1:24,000 scale topographic quadrangle map series for areas
  in the United States and throughout the world. Each tile provides full coverage
  with overlap into adjacent tiles. Data for locations above 56 degrees North/South
  are licensed in 7.5-minute by 15-minute tiles.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
